/* eslint-disable no-unused-vars */
import React from "react";
import "./App.css";
import HomePage from "./Pages/HomePage/HomePage";
import UsersPage from "./Pages/UserAdmin/UsersPage";
import UserAdminPage from "./Pages/UserAdmin/UserAdminPage";
import NewUserPage from "./Pages/UserAdmin/NewUserPage";
import AddTrackPage from "./Pages/TrackerAdmin/AddTrackPage";
import ClientTrackerPage from "./Pages/TrackerAdmin/ClientTrackerPage";
import ClientListPage from "./Pages/ClientAdmin/ClientListPage";
import LoginPage from "./Pages/LoginPage/LoginPage";
import styles from "./assets/scss/styles.scss";
import { ErrorBoundary } from "react-error-boundary";
import ErrorFallBackComponent from "./components/ErrorFallBack";
import {
  BrowserRouter as Router,
  Switch,
  Redirect,
  Route,
} from "react-router-dom";
import PrivateRoute from "./PrivateRoute.js";
import FooterMenuComponent from "./components/FooterMenuComponent.js";
import ScrollToTop from "./components/ScrollToTop";
import NewClientPage from "./Pages/ClientAdmin/NewClientPage";
import EditClientPage from "./Pages/ClientAdmin/EditClientPage";
import MyClientsPage from "./Pages/MyClientsPage/MyClientsPage";

function App() {
  return (
    <>
      <Router>
        <ScrollToTop />
        <Switch>
          <ErrorBoundary
            FallbackComponent={ErrorFallBackComponent}
            onReset={() => {
              // reset the state of your app so the error doesn't happen again
            }}
          >
            <Route exact path="/" component={LoginPage} />
            <PrivateRoute exact path="/home" component={HomePage} />
            <PrivateRoute
              exact
              path="/client_tracker"
              component={ClientTrackerPage}
            />
            <PrivateRoute exact path="/add_track" component={AddTrackPage} />
            <PrivateRoute exact path="/users" component={UsersPage} />
            <PrivateRoute exact path="/admin" component={UserAdminPage} />
            <PrivateRoute exact path="/new-user" component={NewUserPage} />
            <PrivateRoute exact path="/client-mng" component={ClientListPage} />
            <PrivateRoute exact path="/new-client" component={NewClientPage} />
            <PrivateRoute
              exact
              path="/edit_client"
              component={EditClientPage}
            />
            <PrivateRoute exact path="/my-clients" component={MyClientsPage} />
            <Redirect to="/" />
          </ErrorBoundary>
        </Switch>
      </Router>
      <br />
      <br />
      <br />
      <br />
      <br />
      <FooterMenuComponent />
    </>
  );
}

export default App;
